import React from 'react';
import { Box, Heading, SimpleGrid } from '@chakra-ui/react';
import PhishingCampaignCard from "../components/phis";
import PhishingStats from "../components/phishing/PhishingStats";
import NewCampaignForm from "../components/phishing/NewCampaignForm";

const PhishingSimulation = () => {
  return (
    <Box>
      <Heading mb={6}>Phishing Simulation</Heading>
      
      <PhishingStats />
      
      <SimpleGrid columns={{ base: 1, md: 2 }} spacing={6} mt={8}>
        <PhishingCampaignCard />
        <NewCampaignForm />
      </SimpleGrid>
    </Box>
  );
};

export default PhishingSimulation;
